import React from "react";
import "./App.css";

function App() {
  return (
    <div className="App">
      <nav id="navbar" class="nav">
        <ul class="nav-list">
          <li>
            <a href="#about">About</a>
          </li>
          <li>
            <a href="#projects">Projects</a>
          </li>
          <li>
            <a href="#contact">Contact</a>
          </li>
        </ul>
      </nav>
    </div>
  );
}

export default App;
